syntax = "proto3";
package model;
option go_package = "../model";
import "google/protobuf/any.proto";

message MapInfoResult {
	google.protobuf.Any data = 1;
	int64 retcode = 2;
	string status = 3;
}

message BoolYes {
	bool yes = 1;
}

message BoolYesOfResult {
	BoolYes data = 1;
	int64 retcode = 2; 
	string status = 3;
}
